import './videolist.css'
import React, {Component} from 'react'

class VideoList extends Component {

    showVideos = () => {
        console.log(this.props.list)
    }

    render() {
        return (
            <div className='videolist'>
                {this.showVideos}
            </div>
        )
    }
}

export default VideoList;
